// src/components/Lekarz/LekarzList.js
import React, { useState, useEffect } from 'react';
import api from '../../api';

const LekarzList = () => {
  const [lekarze, setLekarze] = useState([]);

  useEffect(() => {
    api.get('/lekarze/')
      .then(response => setLekarze(response.data))
      .catch(error => console.error('Błąd pobierania lekarzy:', error));
  }, []);

  return (
    <div>
      <h2>Lista Lekarzy</h2>
      <ul>
        {lekarze.map(lekarz => (
          <li key={lekarz.id}>{lekarz.imie} {lekarz.nazwisko} - {lekarz.specjalizacja}</li>
        ))}
      </ul>
    </div>
  );
};

export default LekarzList;
